// 在 Code 节点中，Mode 选择 "Run Once for Each Item"

const NEW_KEY = 'Image';

const binary = $input.item.binary || {};

const keys = Object.keys(binary);
if (!keys.length) {
  // 没有 binary 就直接返回原数据
  return $input.item;
}

// 取第一个 binary 字段
const oldKey = keys[0];
if (oldKey === NEW_KEY) {
  // 已经是 image，就不用改
  return $input.item;
}

// 重命名：复制后删除旧 key
binary[NEW_KEY] = binary[oldKey];
delete binary[oldKey];

return $input.item;

// 0. 读取所有输入 items
const inputItems = $input.all();
const outputItems = [];

// ========== 公共工具函数 ==========

// 居中裁剪 + 边界保护
function computeCropRect(srcW, srcH, targetRatio) {
  const srcRatio = srcW / srcH;
  const EPS = 1e-4;

  let cropW = srcW;
  let cropH = srcH;
  let cropX = 0;
  let cropY = 0;

  if (Math.abs(targetRatio - srcRatio) < EPS) {
    // 比例几乎相同，不裁
    cropW = srcW;
    cropH = srcH;
    cropX = 0;
    cropY = 0;
  } else if (targetRatio > srcRatio) {
    // 目标更“宽”：保宽，裁高（上下裁）
    const idealH = srcW / targetRatio;
    cropW = srcW;
    cropH = Math.round(idealH);
    const idealY = (srcH - cropH) / 2;
    cropY = Math.floor(idealY);
    cropX = 0;
  } else {
    // 目标更“高”：保高，裁宽（左右裁）
    const idealW = srcH * targetRatio;
    cropH = srcH;
    cropW = Math.round(idealW);
    const idealX = (srcW - cropW) / 2;
    cropX = Math.floor(idealX);
    cropY = 0;
  }

  // 防止越界：宽高不能超过源图，起点不能为负 / 超出
  cropW = Math.min(cropW, srcW);
  cropH = Math.min(cropH, srcH);
  cropX = Math.max(0, Math.min(cropX, srcW - cropW));
  cropY = Math.max(0, Math.min(cropY, srcH - cropH));

  return { width: cropW, height: cropH, x: cropX, y: cropY };
}

// 为了安全，每个输出 item 拷贝一份 binary
function cloneBinary(bin,batchId,index,presetId) {
  const result = {};
  const indexStr = String(index); // 确保是字符串

  // 简单拼接：batchId_index_presetId
  const newFileName =`B[${batchId}]__I[${indexStr}]__P[${presetId}]`;
  for (const key of Object.keys(bin || {})) {
    result[key] = { ...bin[key] };
    //改文件名
    result[key].fileName=newFileName
  }
  return result;
}

// ========== 1. 定义 PRESETS（去掉暂时不用的高级字段） ==========

const PRESETS = {
  // --- Instagram ---
  Instagram_feed_1x1: {
    platform: "instagram",
    ratio: 1,
    targetW: 1080,
    targetH: 1080,
  },
  Instagram_feed_4x5: {
    platform: "instagram",
    ratio: 4 / 5,
    targetW: 1080,
    targetH: 1350,
  },
  Instagram_story_9x16: {
    platform: "instagram",
    ratio: 9 / 16,
    targetW: 1080,
    targetH: 1920,
  },


  // --- Facebook ---
  Facebook_post_1x1: {
    platform: "facebook",
    ratio: 1,
    targetW: 1080,
    targetH: 1080,
  },
  Facebook_post_4x5: {
    platform: "facebook",
    ratio: 4 / 5,
    targetW: 1080,
    targetH: 1350,
  },
  Facebook_story_9x16: {
    platform: "facebook",
    ratio: 9 / 16,
    targetW: 1080,
    targetH: 1920,
  },
  Facebook_link_16x9: {
    platform: "facebook",
    ratio: 1.91,
    targetW: 1200,
    targetH: 630,
  },

  // --- X / Twitter ---
  X_post_16x9: {
    platform: "x",
    ratio: 16 / 9,
    targetW: 1600,
    targetH: 900,
  },
  X_post_1x1: {
    platform: "x",
    ratio: 1,
    targetW: 1080,
    targetH: 1080,
  },
 /*注释以降低调试难度
  // --- LinkedIn ---
  LinkedIn_post_landscape: {
    platform: "linkedin",
    ratio: 1.91,
    targetW: 1200,
    targetH: 627,
  },
  LinkedIn_post_1x1: {
    platform: "linkedin",
    ratio: 1,
    targetW: 1200,
    targetH: 1200,
  },
  LinkedIn_post_4x5: {
    platform: "linkedin",
    ratio: 4 / 5,
    targetW: 1080,
    targetH: 1350,
  },

  // --- TikTok ---
  TikTok_standard_9x16: {
    platform: "tiktok",
    ratio: 9 / 16,
    targetW: 1080,
    targetH: 1920,
  },

  // --- Pinterest ---
  Pinterest_standard_2x3: {
    platform: "pinterest",
    ratio: 2 / 3,
    targetW: 1000,
    targetH: 1500,
  },

  // --- YouTube ---
  YouTube_thumbnail_16x9: {
    platform: "youtube",
    ratio: 16 / 9,
    targetW: 1280,
    targetH: 720,
  },
  */
};

// 默认就把 PRESETS 里所有 key 都当成默认输出目标
const ALL_PRESET_KEYS = Object.keys(PRESETS);

// ========== 2. 遍历每个输入 item（每张主图） ==========

for (const item of inputItems) {
  if (!item || typeof item.json !== 'object') {
    throw new Error('子流程收到的某个 item.json 不是对象，请检查主流程传入。');
  }

  const json = item.json;
  const originalBinary = item.binary || {};

  // --- 2.1 严格校验源图尺寸（mainImageCheck） ---
  const m = json.mainImageCheck;
  if (!m) {
    throw new Error('缺少 mainImageCheck，请确认主流程已执行体检节点。');
  }

  let srcW = m.width;
  let srcH = m.height;

  if (
    typeof srcW !== 'number' ||
    typeof srcH !== 'number' ||
    !Number.isFinite(srcW) ||
    !Number.isFinite(srcH) ||
    srcW <= 0 ||
    srcH <= 0
  ) {
    throw new Error(`mainImageCheck.width/height 非法：width=${srcW}, height=${srcH}`);
  }

  // 像素统一转整数
  srcW = Math.round(srcW);
  srcH = Math.round(srcH);

  // --- 2.2 严格校验 batchId / index ---
  const rawBatchId = json.batchId ?? m.batchId;
  if (typeof rawBatchId !== 'string' || !rawBatchId.trim()) {
    throw new Error('缺少有效的 batchId，请在主流程中确保为每张图设置 batchId（非空字符串）。');
  }
  const batchId = rawBatchId.trim();

  const rawIndex = json.index ?? m.index;
  if (!Number.isInteger(rawIndex) || rawIndex < 1) {
    throw new Error(`index 非法，应为 >=1 的整数，当前为：${rawIndex}`);
  }
  const index = rawIndex;

  // --- 2.3 决定当前这张图要用哪些 preset ---
  let presetKeys;
  if (Array.isArray(json.presetIds) && json.presetIds.length > 0) {
    presetKeys = json.presetIds;
    // 检查有没有未定义的 key
    const unknown = presetKeys.filter((k) => !PRESETS[k]);
    if (unknown.length) {
      throw new Error(`传入的 presetIds 中有未定义的 key：${unknown.join(', ')}`);
    }
  } else {
    presetKeys = ALL_PRESET_KEYS;
  }

  // --- 2.4 为当前这张主图生成各个 preset 的输出 item ---
  for (const key of presetKeys) {
    const preset = PRESETS[key];
    if (!preset) continue; // 理论上不会发生，这里再兜底

    const crop = computeCropRect(srcW, srcH, preset.ratio);

    const newJson = {
      ...json,
      batchId,
      index,
      presetId: key,
      preset,
      crop,
    };

    outputItems.push({
      json: newJson,
      binary: cloneBinary(originalBinary,batchId,index,key),
    });
  }
}

// 3. 返回所有输出 items
return outputItems;
